import styles from "./styles.module.css";
import { Rating } from "../Rating/Rating";

export const Review = ({ text, rating }) => {
  return (
    <div>
      <div className={styles.root}>{text}</div>
      <Rating size='m' rating={rating} />
    </div>
  );
};
